"use es6";

import React from "react";

const HomePage = () => {
  const url1 = `https://sedo.com/us/photos.html`;
  const url2 = `https://www.cnn.com/`;

  return (
    <>
      <div>
        <h1>HOME</h1>
        <img
          src={
            "https://media1.s-nbcnews.com/i/newscms/2019_21/2870431/190524-classic-american-cheeseburger-ew-207p_d9270c5c545b30ea094084c7f2342eb4.jpg"
          }
          alt={"image 1"}
        />
        <img
          src={
            "https://static01.nyt.com/images/2021/12/16/science/16virus-omicron1/16virus-omicron1-threeByTwoMediumAt2X.jpg"
          }
          alt={"image 2"}
        />
      </div>
    </>
  );
};

export default HomePage;
